import '../buttons/Buttons.css'

const GoBackButton = ({move}) => {
    return(
    <div className='go-back-button'>
        <div className='back-icon'></div>
        <button onClick={() => move(-1)} className='back-button'>Назад</button>
    </div>);
}

export default GoBackButton;
